import React from 'react';
import {Link, Outlet} from 'react-router-dom';

const Welcome = () => {
    return (
        <div>
            <img src="../../public/logo512.png" alt="Logo"></img>
            <br/>
            <button type="button">
                <nav>
                    <Link to="/register">Register</Link>
                </nav>
            </button>
            <Outlet />
        </div>
    )
};

export default Welcome;
